import React from 'react';

function Tour({ data }) {
  return (
    <div>
      {data.map((tour) => (
          <><h2>{tour.name}</h2>
          <img src={tour.image} alt={tour.name} /><hr /></>
      ))}
    </div>
  );
}

export default Tour;
